import React from "react";


function Result(props) {
    const {name} = props

    return (
      <div className="float-left">
        {name&&
          <table class="table">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">Name</th>
              </tr>
            </thead>
            {
              name.map((e, index) => 
                <tr key={index}>
                  <th scope="row">{index}</th>
                  <td>{e}</td>
                </tr>
              )
            }
          </table>           
        }

      </div>

    );
  }

export default Result
